import { render } from "@testing-library/react";
import React from "react";

class LoginForm extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            name: '',
            password: '',
        }
    }

    render() {
        return(
            <form>
                <fieldset>
                    <span>enter login</span>
                    <input type='text' />
                </fieldset>
                <fieldset>
                    <span>enter password</span>
                    <input type='text' />
                </fieldset>
            </form>
            
        )
    }
}

export default LoginForm;
